    const [animate,setAnimate] = useState(false)

    return(
        <div >
            <motion.div className="w-16 h-16 m-4 bg-red-500"
            animate={{
                x:"50vh",
                opacity:1,
                rotate:360
            }}
            initial={{
                opacity:0.5
            }}
            transition={{
                type:"spring",
                stiffness:100
            }}/>


        </div>
    )
}
